import React,{useState, useEffect,Fragment} from 'react';
const Practice = () =>{
const [ profile, setProfile ] = useState({
  name:'',
  age:0
})
const {name, age} = profile;
  return(
    <Fragment>
      <input type = 'text'  onChange = { (e) => setProfile({...profile, name:e.target.value})}/>
      <input type = 'number'  onChange = { (e) => setProfile({...profile, age:e.target.value})}/>
      <h1>Name: {name}</h1>
      <h1>Age: {age}</h1>
    </Fragment>
  )
}

export default Practice;
